import React from 'react';

function TeamSection() {
    const presidents = [
        {
            name: "John Smith",
            role: "Reading Groups",
            image: "https://placehold.co/400x400/e2e8f0/475569?text=JS"
        },
        {
            name: "Jane Doe",
            role: "Workshops and Teaching",
            image: "https://placehold.co/400x400/e2e8f0/475569?text=JD"
        }
    ];

    const boardMembers = [
        {
            name: "Alice Johnson",
            role: "Marketing",
            image: "https://placehold.co/400x400/e2e8f0/475569?text=AJ"
        },
        // Add more board members...
    ];

    return (
        <div className="mx-auto max-w-7xl">
            {/* Presidents Section */}
            <div className="container relative">
                <div className="shrink-0 bg-border h-[1px] w-full" role="none" />
                <h3 className="absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 transform bg-background px-2 text-sm font-semibold text-muted-foreground md:text-xl">
                    Presidents
                </h3>
            </div>

            <ul role="list" className="mx-auto mt-8 grid max-w-2xl grid-cols-2 place-items-center items-center justify-center justify-items-center gap-x-8 gap-y-14 lg:mx-0 lg:max-w-none lg:grid-cols-3 xl:grid-cols-4">
                {presidents.map((member, index) => (
                    <li key={index} className="group shrink-0 cursor-pointer">
                        <div className="flex flex-col items-center">
                            <div className="relative w-fit overflow-hidden rounded-full hover:drop-shadow-lg">
                                <img 
                                    alt={member.name}
                                    width="400"
                                    height="400"
                                    decoding="async"
                                    className="aspect-[14/13] size-36 transform rounded-full object-cover object-top transition-transform duration-300 group-hover:scale-105 sm:size-48"
                                    src={member.image}
                                />
                                <div className="absolute inset-0 transition-colors group-hover:bg-black/50 group-hover:backdrop-blur-sm" />
                                <div className="absolute inset-0 hidden items-center justify-center group-hover:flex">
                                    <p className="text-sm font-medium text-white">Click to see details</p>
                                </div>
                            </div>
                            <h3 className="mt-6 text-nowrap text-center font-semibold leading-8 tracking-tight">
                                {member.name}
                            </h3>
                            <p className="text-center text-sm leading-6 text-gray-500">
                                {member.role}
                            </p>
                        </div>
                    </li>
                ))}
            </ul>

            {/* Board Members Section */}
            <div className="container relative mt-6">
                <div className="shrink-0 bg-border h-[1px] w-full" role="none" />
                <h3 className="absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 transform bg-background px-2 text-sm font-semibold text-muted-foreground md:text-xl">
                    Board Members
                </h3>
            </div>

            <ul role="list" className="mx-auto mt-8 grid max-w-2xl grid-cols-2 place-items-center items-center justify-center justify-items-center gap-x-8 gap-y-14 lg:mx-0 lg:max-w-none lg:grid-cols-3 xl:grid-cols-4">
                {boardMembers.map((member, index) => (
                    <li key={index} className="group shrink-0 cursor-pointer">
                        <div className="flex flex-col items-center">
                            <div className="relative w-fit overflow-hidden rounded-full hover:drop-shadow-lg">
                                <img 
                                    alt={member.name}
                                    width="400"
                                    height="400"
                                    decoding="async"
                                    className="aspect-[14/13] size-36 transform rounded-full object-cover object-top transition-transform duration-300 group-hover:scale-105 sm:size-48"
                                    src={member.image}
                                />
                                <div className="absolute inset-0 transition-colors group-hover:bg-black/50 group-hover:backdrop-blur-sm" />
                                <div className="absolute inset-0 hidden items-center justify-center group-hover:flex">
                                    <p className="text-sm font-medium text-white">Click to see details</p>
                                </div>
                            </div>
                            <h3 className="mt-6 text-nowrap text-center font-semibold leading-8 tracking-tight">
                                {member.name}
                            </h3>
                            <p className="text-center text-sm leading-6 text-gray-500">
                                {member.role}
                            </p>
                        </div>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default TeamSection;
